import React,{useState} from 'react';
import {FaBars,FaTimes} from 'react-icons/fa';
import {Nav,NavbarContainer,NavLogo,MobileIcon,NavMenu,NavItem,NavLinks} from './Navbar.Elements';
import {IconContext} from 'react-icons/lib';
import { AiFillHome } from "react-icons/ai";
import { GrDirections } from "react-icons/gr";


function Navbar() {
    const [click,setClick]=useState(false)
    const handleClick = () => setClick(!click)
    return (
<>
<IconContext.Provider value={{color:'#fff'}}>
<GrDirections.Provider value={{color:'#fff'}}>
<Nav>
<NavbarContainer>
  <NavLogo to='/'>
  <div>
    LOGO
      </div>
    </NavLogo>
    <MobileIcon onClick={handleClick}>
      {click ? <FaTimes /> : <FaBars />}
      </MobileIcon>
      <NavMenu onClick={handleClick} click={click}>
         <NavItem>
             <NavLinks to='/'> <span style={{marginRight:' 7px ',}}>  <AiFillHome /> </span>  Home </NavLinks>
             </NavItem>
         <NavItem>
             <NavLinks to='/'> <span style={{marginRight:' 7px ',}}>  <GrDirections /> </span> Use API </NavLinks>
             </NavItem>
         <NavItem>
             <NavLinks to='/'>Log in  </NavLinks>
             </NavItem>
         <NavItem>
             <NavLinks to='/'>SignUp </NavLinks>
             </NavItem>
             </NavMenu>
  </NavbarContainer>
</Nav>
</GrDirections.Provider>
</IconContext.Provider>


</>
 );
}
export default Navbar;
